import React from 'react';
import Noticia from './noticia';
import 'bootstrap/dist/css/bootstrap.min.css';

import './App.css';

function App() {
  return (
    <div className="App">
    <div className="noticia">
      <Noticia/>
      <div>
      <ControlledCarousel />
      </div>
    </div>
    </div>
  );
}

export default App;
